import React, {Component} from 'react';
import stylesheet from './styles.js'
import Button from './Button';

export default class Home extends React.Component {
	constructor(props) {
		super(props);
		this.state = {test: 0};
	}
	render() {
		return (
			<div id="root" style={stylesheet.body}>
				<h1 style={stylesheet.homemain}>Welcome to Star Coder</h1>

			</div>
		);
	}

}
